import logo from "./logo.svg";
import "./App.css";

function App() {
  const [titulo, setTitulo] = React.useState(null);


  return (
    <div className="App">
      <header className="App-header">
        <p>{!titulo ? "Cargando..." : titulo}</p>
      </header>
      <div className="App-body">
        <h1>Identificador de colaboradores</h1>
      </div>
    </div>
  );
}

export default App;
